import React from 'react';

const Parent = () => (
  <div>
    <p>Child 1</p>
    <p>Child 2</p>
  </div>
);

const GetFiber = () => {
  const child = (<Parent />)._owner;
  return <p>See log for child fiber - {console.log(child)}</p>;
};

const FiberArchitecture = () => {
  return (
    <div>
      <h2>Fiber Architecture:</h2>
      <GetFiber />
    </div>
  );
};

export default FiberArchitecture;
